import React from 'react';
import logo from './logo.svg';
import {Table} from 'reactstrap';
import './App.css';
import { Header } from './Header';
import { GameDex } from './GameDex.js';
import { Footer } from './Footer';


export default class App extends React.Component {
  constructor() {
    super()
    console.log("test")
  }

  render() {
    return (
      <div className="App container">

      <Table>
        <thead>
            <tr>
              <th>#</th>
              <th>Title</th>
              <th>Rating</th>
              <th>Actions</th>
            </tr>
        </thead>
      </Table>

      <tbody>
        <tr>
          <td>1</td>
          <td>Book title</td>
          <td>2,5</td>
          <td>
            <button color="success" size="sm-2">Edit</button>
            <button color="success" size="sm">Delete</button>
          </td>
        </tr>
      </tbody>

      <Header />
        <Footer />
        <GameDex />
      </div>
    )
  }
}
